# Project Manager: Track Tech Thursday issues
class IssueTracker:
    def __init__(self):
        self.issues = []

    def add_issue(self, description: str, priority: int):
        self.issues.append({
            'id': len(self.issues) + 1,
            'description': description,
            'priority': priority,
            'status': 'open'
        })

    def get_priority_issues(self, min_priority: int):
        return [issue for issue in self.issues if issue['priority'] >= min_priority]

# Testing Coordinator: Create user testing summaries
